@-moz-document domain(millsp.github.io) {

    body {
      background: #faf9f8;
      color: #3e485b;
      font-size: 16px;
      line-height: 1.6;
    }

    .tsd-page-toolbar {
      background: #3178c6;
    }

    .tsd-page-toolbar a.title {
      color: #fff;
    }

    .tsd-panel {
      border-color: #dddddd;
      border-width: 1px;
      box-shadow: none;
      background: #fff;
    }

    .tsd-navigation > ul {
      background: #fff;
      color: black;
      border-color: #ddd;
      border-width: 1px;
      box-shadow: none;
      font-family: Consolas,Source Code Pro,Courier New;
      font-size: 14px;
      line-height: 2;
    }

    pre {
      background: #f8f8ff;
      padding: 1em;
      line-height: 1.4;
    }

    code, ul.tsd-type-parameters .name {
      background: #f1f1fe;
      color: #000;
    }
    pre, code {
      font-size: 16px;
    }

    .tsd-panel table tr {
      background: #f1f1f1;
    }

    .tsd-navigation a {
      color: #3e485b;
    }

    .tsd-breadcrumb {
      color: #ddd;
    }

    .tsd-breadcrumb a {
      color: #3078c6;
    }

    .tsd-panel table tr:nth-child(2n) {
      background: #fff;
    }


    .tsd-panel h1, .tsd-panel h2, .tsd-panel h3, .tsd-panel h4 {
      border-color: #f6f6f6;
    }

    .tsd-page-title {
      box-shadow: none;
      border-bottom: 1px solid #ddd;
      background: #fff;
    }

    #tsd-filter .tsd-filter-group {
      color: #fff;
    }

    footer .tsd-legend-group {
      background: #fff;
      border: 1px solid #ddd;
      box-shadow: none;
    }

    footer .tsd-legend {
      font-size: 14px;
    }

    footer .tsd-legend li {
      margin: 10px;
    }

    footer.with-border-bottom {
      border-bottom: none;
    }

    footer + div {
      margin-bottom: 20px!important;
      color: #64768d;
    }

    .tsd-signature, .tsd-signatures {
      border-color: #ddd;
      background: #eee;
    }

    .tsd-index-panel a, .tsd-index-panel .tsd-parent-kind-module a {
      color: #3078c6;
      font-weight: 600;
    }

    .tsd-index-panel .tsd-kind-module a {
      color: #3e485b;
    }

    a, .tsd-signature-type, .tsd-index-panel a, .tsd-index-panel .tsd-parent-kind-module a {
      color: #3078c6;
    }

    .tsd-panel-group > h1, .tsd-panel-group > h2, .tsd-panel-group > h3 {
      padding: 0;
    }

    .tsd-signature-symbol {
      color: #795548;
      font-weight: 500;
      margin-left: 5px;
      margin-right: 3px;
    }

    .menu-sticky-wrap .tsd-navigation .tsd-kind-module a::first-letter {
      border: 1px solid #FFC107;
      padding: 2px 5px;
      margin-right: 3px;
      border-radius: 30px;
    }

    .tsd-kind-module {
      white-space: nowrap;
    }

    .tsd-kind-module wbr {
      display: none;
    }

}
